import {LOGIN, REGISTER, LOADING, LOGIN_CREATOR, REGISTER_CREATOR} from "./AuthConstants";

export const loginCreator = (data) => ({ type: LOGIN_CREATOR});
export const loginAction = (data) => ({ type: LOGIN, payload: data });
export const registerCreator = () => ({ type: REGISTER_CREATOR});
export const registerAction = (data) => ({ type: REGISTER, payload: data });
export const loading = (data) => ({type: LOADING, payload: data});
